console.log(typeof completed); // boolean`,required:!1}],[{type:"p",content:"Booleans are mostly used in making decisions and are one of the main types you'll use the most."}],[{type:"hr"},{type:"p",content:"JavaScript allows values of other types to be converted into boolean values of ##true## or ##false##."},{type:"p",content:"To convert a value of another data type into a boolean value, you use the ##Boolean()## function:"}]],"assign-boolean":[[{type:"p",content:"**Challenge:** create and declare a ##boolean## so the result is ##true##:"},{type:"code",content:"",required:!0,expected:"true"}]],"undefined-type":[[{type:"p",content:"The ##undefined## only has one value: ##undefined##."},{type:"p",content:"By default, when a variable is declared but not initialized, it is assigned the value of ##undefined##:"},{type:"code",content:`let name;

