console.log(typeof name); // undefined`,required:!1}],[{type:"p",content:"In the example, ##name## is a variable. Since ##name## hasn't been initialized, it is assigned the value of ##undefined##."},{type:"p",content:"It's important to note that the ##typeof## operator also returns ##undefined## when you call it on a variable that hasn't been declared:"},{type:"code",content:"console.log(typeof undeclaredVariable); // undefined",required:!1}]],"null-type":[[{type:"p",content:"The ##null## type is the second data type that also only has one value: ##null##:"},{type:"code",content:`let obj = null;

